pc.script.createLoadingScreen(function (app) {
    var showSplash = function () {
        const wrapper = document.createElement('div');
        wrapper.id = 'application-splash-wrapper';
        document.body.appendChild(wrapper);

        const splash = document.createElement('div');
        splash.id = 'application-splash';
        wrapper.appendChild(splash);


        const imageLinks = [
            'data:image/png;base64,',
            'data:image/png;base64,',
            'data:image/png;base64,',
            'data:image/png;base64,',
            'data:image/png;base64,',
            'data:image/png;base64,',
            'data:image/png;base64,'
        ];
        const trophyCount = 7;

        for (let i = 0; i < trophyCount; i++) {
            const img = document.createElement('img');
            img.src = imageLinks[i % imageLinks.length];
            img.classList.add('trophy');

            img.style.animationDelay = `${i * 0.2}s`;
            img.style.zIndex = i;

            const scale = 14 - i * 2;
            img.style.setProperty('--scale-target', scale);

            splash.appendChild(img);
        }
    };

    var hideSplash = function () {
        const splash = document.getElementById('application-splash-wrapper');
        if (splash && splash.parentElement) {
            splash.parentElement.removeChild(splash);
        }
    };

    var createCss = function () {
        const css = `
        body {
            margin: 0;
            background-color: #154472;
        }
        #application-splash-wrapper {
            position: fixed;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            display: flex;
            align-items: center;
            justify-content: center;
            background-color: #154472;
            overflow: hidden;
        }
        #application-splash {
            position: relative;
            width: 100vw;
            height: 100vh;
        }
        .trophy {
            position: absolute;
            top: 50%;
            left: 50%;
            width: 200px;
            height: 200px;
            transform: translate(-50%, -50%) scale(0);
            transform-origin: center center;
            animation: grow 0.6s forwards ease-out;
        }
        @keyframes grow {
            0% {
                transform: translate(-50%, -50%) scale(0);
                opacity: 0;
            }
            100% {
                transform: translate(-50%, -50%) scale(var(--scale-target));
                opacity: 1;
            }
        }
        `;
        const style = document.createElement('style');
        style.type = 'text/css';
        style.appendChild(document.createTextNode(css));
        document.head.appendChild(style);
    };

    createCss();
    showSplash();

    app.on('preload:end', function () {
        app.off('preload:progress');
    });

    app.on('start', hideSplash);
});
